import React from 'react';
import { Link } from 'react-router-dom'; // Importar Link de React Router
import './Header.css';
import logo from '../../assets/images/logo.svg'; // Aseg√∫rate de que el logo est√© en esta ruta

const Header = () => {
    return (
        <header className="header">
            <div className="header-container">
                {/* Logo */}
                <div className="logo">
                    <img src={logo} alt="USX Tienda Logo" className="logo-image" />
                    <span className="logo-text">USX Tienda</span>
                </div>

                {/* Barra de b√∫squeda */}
                <div className="search-bar">
                    <input
                        type="text"
                        placeholder="Buscar productos..."
                        className="search-input"
                    />
                    <button className="search-button">üîç</button>
                </div>

                {/* Navegaci√≥n */}
                <nav className="nav">
                    <ul className="nav-list">
                        <li><Link to="/">Inicio</Link></li>
                        <li><Link to="/products">Productos</Link></li>
                        <li><Link to="/about">Nosotros</Link></li>
                        <li><Link to="/contact">Contacto</Link></li>
                    </ul>
                </nav>

                {/* Botones de usuario */}
                <div className="user-actions">
                    <button className="btn login-btn">Login</button>
                    <button className="btn cart-btn">Carrito</button>
                </div>
            </div>
        </header>
    );
};

export default Header;
